import React from 'react';


const Wrap = styled.div `
    display: flex;
    justify-content: center;
`

const Projects = () => {
    return ( 
        <Wrap>
            <img src={require('../../public/project-GOL')} alt="projects game of life" />
        </Wrap>
     );
}

export default Projects;
